import React from 'react';
// import { NavLink } from 'react-router-dom';
import { Navbar, NavbarBrand, NavbarNav, NavItem, NavLink, NavbarToggler, Collapse } from "mdbreact";

class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isOpen: true
        }
    }

    toggle = () => {
        this.setState(state => ({isOpen: !state.isOpen}));
    }

    render() {
        return (
            <Navbar dark expand="sm">
                <NavLink to="/">
                    <NavbarBrand>
                        <img src="images/logo.png" alt="webinjaz io"/>
                        <span className="current">{this.props.current && this.props.current} <small>{this.props.version && this.props.version}</small></span>
                    </NavbarBrand>
                </NavLink>
                <NavbarToggler onClick={() => this.toggle} />
                <Collapse id="NC" isOpen={this.state.isOpen} navabr>
                    <NavbarNav right>
                        <NavItem>
                            <NavLink to="/build">Build Tool</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink to="https://webinjaz.gitbook.io/framework/guide">Guide</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink to="https://webinjaz.gitbook.io/framework">Docs</NavLink>
                        </NavItem>
                    </NavbarNav>
                </Collapse>
            </Navbar>
        )
    }
}

export default Header;
